import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './TeamsPage.css';
import logoImage from './photo.png';

const TeamsPage = () => {
  const [activeSection, setActiveSection] = useState('admin');
  const [isSticky, setIsSticky] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      // Make navbar sticky when scrolling down
      setIsSticky(window.scrollY > 115);
      
      // Detect which section is in view
      const sections = ['admin', 'writers', 'designers', 'developers'];
      const scrollPosition = window.scrollY + 200;
      
      for (const section of sections) {
        const element = document.getElementById(section);
        if (element) {
          const offsetTop = element.offsetTop;
          const offsetHeight = element.offsetHeight;
          
          if (scrollPosition >= offsetTop && scrollPosition < offsetTop + offsetHeight) {
            setActiveSection(section);
            break;
          }
        }
      }
    };
    
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const scrollToSection = (sectionId) => {
    setActiveSection(sectionId);
    const element = document.getElementById(sectionId);
    if (element) {
      window.scrollTo({
        top: element.offsetTop - 100,
        behavior: 'smooth'
      });
    }
  };

  // Team members data
  const teamMembers = {
    admin: [
      { name: 'Full Name', linkedin: '#' },
      { name: 'Full Name', linkedin: '#' },
      { name: 'Full Name', linkedin: '#' }
    ],
    writers: [
      { name: 'Full Name', linkedin: '#' },
      { name: 'Full Name', linkedin: '#' },
      { name: 'Full Name', linkedin: '#' }
    ],
    designers: [
      { name: 'Full Name', linkedin: '#' },
      { name: 'Full Name', linkedin: '#' },
      { name: 'Full Name', linkedin: '#' }
    ],
    developers: [
      { name: 'Full Name', linkedin: '#' },
      { name: 'Full Name', linkedin: '#' },
      { name: 'Full Name', linkedin: '#' }
    ]
  };

  return (
    <div className="teams-container">
      {/* Navbar */}
      <nav className={`navbar ${isSticky ? 'sticky' : ''}`}>
        <div className="logo">
          <img src={logoImage} alt="CSE Logo" />
        </div>
        <div className="nav-links">
          <Link to="/">Home</Link>
          <Link to="/teams" className="active">Teams</Link>
          <Link to="/bytestreams" className="highlight bytestreams">Bytestreams</Link>
          <Link to="/buffered-readers" className="highlight buffered-readers">Buffered Readers</Link>
          <Link to="/about">About Us</Link>
        </div>
      </nav>

      {/* Team Header */}
      <div className="team-header">
        <h1>OUR TEAM</h1>
        <div className="team-nav">
          <div 
            className={`team-nav-item ${activeSection === 'admin' ? 'active' : ''}`}
            onClick={() => scrollToSection('admin')}
          >
            ADMIN
          </div>
          <div 
            className={`team-nav-item ${activeSection === 'writers' ? 'active' : ''}`}
            onClick={() => scrollToSection('writers')}
          >
            WRITERS
          </div>
          <div 
            className={`team-nav-item ${activeSection === 'designers' ? 'active' : ''}`}
            onClick={() => scrollToSection('designers')}
          >
            DESIGNERS
          </div>
          <div 
            className={`team-nav-item ${activeSection === 'developers' ? 'active' : ''}`}
            onClick={() => scrollToSection('developers')}
          >
            DEVELOPERS
          </div>
        </div>
      </div>

      {/* Team Sections */}
      <div className="team-sections">
        {Object.keys(teamMembers).map((section) => (
          <section 
            key={section} 
            id={section} 
            className={`team-section ${section}`}
          >
            <h2>{section.toUpperCase()}</h2>
            <div className="team-members">
              {teamMembers[section].map((member, index) => (
                <div key={index} className="member-card">
                  <div className="member-photo">
                    {/* Placeholder for member photo */}
                    <div className="photo-placeholder"></div>
                  </div>
                  <div className="member-info">
                    <h3>{member.name}</h3>
                    <a href={member.linkedin} className="linkedin-link">LinkedIn</a>
                  </div>
                </div>
              ))}
            </div>
          </section>
        ))}
      </div>

      {/* Footer */}
      <footer className="footer">
        <p>CSE Society: IIT ISM Dhanbad</p>
      </footer>
    </div>
  );
};

export default TeamsPage;
